            <h3>Apa itu Force?</h3>

            <p>FORCE (Filkom on Fire for Change) 2016, merupakan nama Dies Natalis FILKOM yang ke - 5</p>

                <a class="modal-trigger waves-effect waves-light btn" href="#modal1">Filosofi Logo</a>

                <a class="modal-trigger waves-effect waves-light btn" href="#modal2">Filosofi Nama</a>

            </div>

        </div>

        <div id="modal1" class="modal">

            <div class="modal-content">

                <p>

                    <li>Berbentuk Rocket, yang bermakna menjadi lebih baik dan menuju pencapaian yang tinggi.</li>

                    <li>Badan membentuk angka lima, sebagai tanda 5 tahun berdirinya FILKOM.</li>

                    <li>Dua sayap sebagai penyimbang, mempunyai makna keseimbangan dari semua komponen FILKOM.</li>

                    <li>Enam buah api pendorong, melambangkan enam prodi yang ada sebagai tenaga untuk mencapai FILKOM yang lebih baik.</li>

                </p>

            </div>

        </div>

        <div id="modal2" class="modal">

            <div class="modal-content">

                <p>

                    <li>Dari artinya, yaitu kekuatan atau tenaga, bermakna untuk menjadi lebih baik.</li>

                    <li>Filkom butuh kekuataan, dimana kekuataan tersebut didapat dari rasa kebersamaan, persatuan, kesatuan, dan kekeluargaan dari FILKOM itu sendiri sebagaimana tergambar dalam logo.</li>

                    <li>FILKOM on Fire for Change merupakan sebuah semangat dan harapan agar FILKOM terus berbenah menjadi lebih baik, mengingat Dies Natalis FILKOM merupakan momen yang tepat untuk suatu perubahan yang lebih baik.</li> 

                </p>

            </div>

        </div>

